export default function User(props) {
    const { campaign } = props;
    return (
        <div>
            <h1>User</h1>
            <h1>{campaign?.title}</h1>
            <img src={campaign?.image} alt="" />
            <h3>{campaign?.goal}</h3>
            <p>{campaign?.description}</p>
            <button>Update</button>

        </div>
    )
}
